import React, { useState, useEffect } from "react";
import "../Styles/Navbar.css";
import { Link } from "react-router-dom";
import MenuIcon from "@material-ui/icons/Menu";
import CloseIcon from "@material-ui/icons/Close";

function Navbar() {
  const [navbar, setNavbar] = useState(false);
  const [mobileview, setMobileView] = useState(true);
  const [click, setClick] = useState(false);

  const showMenuBar = () => {
    if (window.innerWidth > 960) {
      setMobileView(false);
    } else {
      setMobileView(true);
    }
  };

  const shrinkNavbar = () => {
    if (window.scrollY > 60) {
      setNavbar(true);
    } else {
      setNavbar(false);
    }
  };

  const menuBarClick = () => {
    setClick(!click);
  };

  useEffect(() => {
    showMenuBar();
  }, []);

  console.log(navbar.valueOf());

  window.addEventListener("resize", showMenuBar);
  window.addEventListener("scroll", shrinkNavbar);

  return (
    <>
      <div className={navbar ? "nav-shrink" : "nav-large"}>
        <div className="navbarContainer">
          <div
            className={
              navbar ? "shrink-title-logo-container" : "title-logo-container"
            }
          >
            <Link to="/random">
              <img src="" alt="logo from db" className="logo" />
            </Link>
            <h5>GES TEXT FROM DB</h5>
          </div>
          <div className="navmenu" onClick={menuBarClick}>
            <i className="icon">
              {click ? (
                <MenuIcon className="menuicon" />
              ) : (
                <CloseIcon className="closeicon" />
              )}
            </i>
          </div>

          <div
            className={
              navbar ? "navigation-container" : "blank-navigation-container"
            }
          >
            <div className={mobileview ? "nav-bar-active" : "navbar"}>
              <li className="navitems">
                <Link to="/aboutus" className="nav-links">
                  About us
                </Link>
              </li>
              <li className="navitems">
                <Link to="/aboutus" className="nav-links">
                  About us
                </Link>
              </li>
              <li className="navitems">
                <Link to="/aboutus" className="nav-links">
                  About us
                </Link>
              </li>
              <li className="navitems">
                <Link to="/aboutus" className="nav-links">
                  About us
                </Link>
              </li>
              <li className="navitems">
                <Link to="/aboutus" className="nav-links">
                  About us
                </Link>
              </li>
              <li className="navitems">
                <Link to="/aboutus" className="nav-links">
                  About us
                </Link>
              </li>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Navbar;
